import { Link } from 'react-router-dom';
import Image from '../assets/avator.png';

const ImageIcon = () => {
  return (
    <div>
      <Link to="/">
      <img src={Image} alt="Icon" width={64} height={64} />
      </Link>
    </div>
  );
};

export default ImageIcon;
